import React from 'react';
import 'react-bulma-components/dist/react-bulma-components.min.css';
import { Hero, Heading } from 'react-bulma-components';
// import MenuComponent from './Menu.js';


const HeroComponent = () => {
    return (
    <Hero size="large" color="black" style={styles.header}>
      <Hero.Head renderAs="header">
          {/* <MenuComponent></MenuComponent> */}
        <div className="bd-notification is-info">Hybrid Insurance</div>
      </Hero.Head>
      <Hero.Body >

        <div>
         <Heading>Hybrid Insurance</Heading>
        We provide adaptive insurance for you & your vehicle
        </div>
      </Hero.Body>
      <Hero.Footer>
        <div className="bd-notification is-danger"></div>
      </Hero.Footer>
    </Hero>
    )
    }
export default HeroComponent
